import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {

    const items = ['Lern React', 'Build Awesome App', 'Drink Coffe'];
    items.map((item, index) => {
        const li = '';
        test += <li>{items[index]}</li>
        return test;
    });
    return(
        <ul>
            {test};
        </ul>
    );
};

const AppHeader = () => {
    return(
        <h1>My Todo List</h1>
    );
}

const SearchPanel = () => {
    return (
        <input type="text" placeholder="search"/>
    );
};

const App = () => {
    return(
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
